import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, id, questionId}){

    const t = {questionId};

    const q = (t) => {
        getQuestionId(t);
    };

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
            <p>{q.title}</p>


        </Paper>
    )
}

export default Question;
